import React, {Component} from 'react';
import {Grid, Divider, GridColumn, Container, Header, Placeholder} from 'semantic-ui-react';
import {Menu, Input, Image} from 'semantic-ui-react';
import image from '../images/square-image.png';
//import './Leftwing.css';


class Leftwing extends Component{

    state = {}
    handleItemClick = (e, { name }) => this.setState({ activeItem: name})

    render(){

        const {activeItem} = this.state;

        return(

            <Menu vertical color="blue">
                <Menu.Item>
                    <Image src={image} circular size="small" />

                </Menu.Item>


                <Menu.Item>
                    <Input placeholder="Search the site..."></Input>
                </Menu.Item>

                <Menu.Item>
                    Dr. Whatever Your Name
                </Menu.Item>

                <Menu.Item>
                    Home
                    <Menu.Menu>
                        <Menu.Item name="Profile" active={activeItem == 'add'} onClick={this.handleItemClick}>Profile</Menu.Item>
                        <Menu.Item name="Patients" active={activeItem == 'patients'} onClick={this.handleItemClick}>Patients</Menu.Item>
                        <Menu.Item name="Medicines" active={activeItem == 'medicines'} onClick={this.handleItemClick}>Medicines</Menu.Item>
                        <Menu.Item name="Procedures" active={activeItem == 'procedures'} onClick={this.handleItemClick}>Procedures</Menu.Item>
                    </Menu.Menu>
                </Menu.Item>



            </Menu>

            // <div className="wingspan">
            //     <Container>
            //         <Placeholder>
            //             <Header>Here lies the image of the user.</Header>
            //             <Divider>

            //             </Divider>

            //             ASD
            //             adsa
            //             defaultdas
            //             d
            //         </Placeholder>
            //     </Container>
            // </div>

        );
    }
}


export default Leftwing;
